import React, { Component } from 'react';
import { connect } from 'react-redux';
import { compose } from 'redux';
import HotKeys from 'components/higherOrderComponents/hotKeys';
import { AppHotKeys } from 'components/hotKeys/appHotKeys';
import { Navbar } from 'components/navBar';
import CollectionListConnect from 'components/higherOrderComponents/collectionListConnect';
import { STRING_CONSTANTS } from 'shared/constants/stringConstants';

export class App extends Component {
    render() {
        return (
            <>
                <Navbar title={STRING_CONSTANTS.NAVBAR.TITLE}/>
                <br/>
                <CollectionListConnect />
            </>
        );
    }
}

export const mapStateToProps = (state, props) => ({
    ...props,
});

export const hotKeyConnect = compose(
    HotKeys(AppHotKeys.KeyMap, AppHotKeys.Handlers),
    connect(mapStateToProps),
);

export default hotKeyConnect(App);
